    return (
        <>
            <div>
                <h1>Чем я это делаю?</h1>
                <p>Предпочитаю работать с собственной сборкой и знакомыми технологиями, но не боюсь работать иначе.</p>
            </div>

            <div>
                <p>Основные технологии</p>
            </div>
        </>
    );
}

export default Tool;
